Definition:
Place Holder for any observation of an event.  See: EventType.  &lt;xhtml:table&gt;
&lt;xhtml:tr&gt;&lt;xhtml:td colspan=&quot;&quot;2&quot;&quot;&gt;In the context of an Observation, the interpretation of some of the properties shall be refined as follows:&lt;/xhtml:td&gt;&lt;/xhtml:tr&gt;
&lt;xhtml:tr&gt;&lt;xhtml:td&gt;time&lt;/xhtml:td&gt;&lt;xhtml:td&gt;the date/Time at which the procedure was executed&lt;/xhtml:td&gt;&lt;/xhtml:tr&gt;
&lt;xhtml:tr&gt;&lt;xhtml:td&gt;location&lt;/xhtml:td&gt;&lt;xhtml:td&gt;the location of the procedure (sensor, intrument, computational engine) at the time of the observation event&lt;/xhtml:td&gt;&lt;/xhtml:tr&gt;
&lt;xhtml:tr&gt;&lt;xhtml:td&gt;procedure&lt;/xhtml:td&gt;&lt;xhtml:td&gt;the procedure used to record the event&lt;/xhtml:td&gt;&lt;/xhtml:tr&gt;
&lt;/xhtml:table&gt;
